        prHeader.Create_Date = DateValue;
        prHeader.Pr_Urgent = "No";

        //base.OnInitialized();
        authState = await _authState;
        MyClaims = (await _authState).User;
        thisUser = _UserManager.Users.FirstOrDefault(x => x.UserName == MyClaims.Identity.Name);
        if (thisUser != null)
        {
